import React from 'react';

const styles = {
  border: '1px solid black'
};

const ListItem = ({ item }) => {
  return (
    <div style={styles}>
      <h5>{item.name}</h5>
      <h6>Price: {item.price}</h6>
    </div>
  );
};

export default ListItem;
